import React from 'react';
import Compo from "./compo";

function Food(props) {
  return (
    <h3>I like {this.prop}.</h3>
  );
}

function App() {
  return (
    <div className="App">
      Hello
      <Compo></Compo>
      <Food prop="Banana"></Food>
    </div>
  );
}

export default App;
